import React from 'react';

import './fashionEssentialsCard.styles.scss';

const FashionEssentialsCard = ({ title, id, imgUrl, style }) => (
    <div className='card'>
        <img src={ imgUrl } alt={ title } className='card__img'></img>
        <div className='card__content'>
            <h2 className='card__content--heading' style={{style}}>{ title }</h2>
            <a href='#' className='card__content--button'>Shop Now</a>
        </div>
    </div>
)

export default FashionEssentialsCard;
